    data: |
      SELECT ALL - cor0.col0 - + cor0.col1 / ( - NULLIF ( - cor0.col0, cor0.col1 * cor0.col0 ) ) FROM tab0 cor0 GROUP BY cor0.col0, cor0.col1;
  - name: tab0

outputs:
  - name: q3901.out
    data: |
      -26
      -44
      -83
